import React, { Component } from 'react';
import Todo from './todo';

class Todos extends Component {
    state = {
        todos:[
            {name : "React", count : 0},
            {name : "Three.js", count : 0},
            {name : "jQuery", count : 0},
        ],
    };

    render() {
        return (
            <ul>
                {
                    this.state.todos.map(todo =>(
                        <Todo />
                    ))
                }
            </ul>
        );
    }

}

export default Todos;
